'use strict';

var randu = require( '@stdlib/math/base/random/randu' );
var cdf = require( './../lib' );

var alpha;
var beta;
var x;
var y;
var i;

for ( i = 0; i < 10; i++ ) {
	x = randu() * 10.0;
	alpha = randu() * 10.0;
	beta = randu() * 10.0;
	y = cdf( x, alpha, beta );
	console.log( 'x: %d, α: %d, β: %d, F(x;α,β): %d', x, alpha, beta, y );
}
